import './style.css';
import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';



function App() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (!file) return;

    setLoading(true);
    Papa.parse(file, {
      header: true,
      complete: (results) => {
        setData(results.data);
        setLoading(false);
      },
      error: (error) => {
        setError(error.message);
        setLoading(false);
      }
    });
  };

  return (
    // <div className="table">
    //   <div className="table__row">
    //     <div className="table__element table__element-name">

    //     </div>
    //     <div className="table__element table__element-name">

    //       </div>
    //       <div className="table__element table__element-name">

    //       </div>
    //       <div className="table__element table__element-name">

    //       </div>
    //       <div className="table__element table__element-name">

    //       </div>
    //   </div>
    // </div>
    <div>
      <input
        type="file"
        accept=".csv"
        onChange={handleFileUpload}
      />
      {loading && <p>Loading...</p>}
      {error && <p>Error: {error}</p>}
      {!loading && !error && (
        <table>
          <thead>
            <tr>
              <th>Column 1</th>
              <th>Column 2</th>
              <th>Column 3</th>
              <th>Column 4</th>
              <th>Column 5</th>
            </tr>
          </thead>
          <tbody>
            {data.map((row, index) => (
              <tr key={index}>
                <td>{row['Column 1']}</td>
                <td>{row['Column 2']}</td>
                <td>{row['Column 3']}</td>
                <td>{row['Column 4']}</td>
                <td>{row['Column 5']}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default App;
